local function bxor(a, b)
    local res = 0
    for i = 0, 7 do
        local x = a % 2
        local y = b % 2
        if x ~= y then res = res + 2^i end
        a = math.floor(a / 2)
        b = math.floor(b / 2)
    end
    return res
end

local function unshuffleTable(t, order)
    local r = {}
    for i, idx in ipairs(order) do
        r[idx] = t[i]
    end
    return r
end

local function runEncoded(bytes, keys, order)
    bytes = unshuffleTable(bytes, order)
    local str = {}
    for i = 1, #bytes do
        local key = keys[(i - 1) % #keys + 1]
        str[i] = string.char(bxor(bytes[i], key))
    end
    local fn = load(table.concat(str))
    if fn then fn() end
end

